import Layout from '../components/MyLayout';

export default function FotoXL() {
  const aboutStyle = {
    textAlign: 'center',
    fontFamily: '"Arial Black", Gadget, sans-serif'

  }
  const aboutContainer = {
    padding: '5em'
  }
  const aboutHeading = {
    fontSize: '5em',
    fontWeight: 'bold',
    fontFamily: '"Arial Black", Gadget, sans-serif'
  }
  return (
    <Layout >
      <div class="parallax5"></div>
    <div  style={aboutContainer}>
      <div style={aboutHeading}>FotoXL</div>
      <p style={aboutStyle}>
      Virtual Photo Booth
      </p>
      <p style={aboutStyle}>
      Virtual Photo Booth
Digital marketing
Virtual events
Text marketing
      </p>
      <p style={aboutStyle}>
        We have over 25 years of experience working to tailor our presentation to fit our clients needs and providing them with fun, interactive entertainment. Our goal is to keep a smile on your face by making certain your guests have one on theirs.
      </p>
      <p style={aboutStyle}>
        We look forward to learning how we can make your next event a successful one.</p>
      </div>     
       <div class="parallax6"></div>
    </Layout>
  );
}
